import React from 'react';
import './App.css';
import MenuTable from './MenuTable';
import { loadErrorMessages, loadDevMessages } from "@apollo/client/dev";

if (__DEV__) {  // Adds messages only in a dev environment
  loadDevMessages();
  loadErrorMessages();
}

function App() {
  return (
    <div className="App">
      <h1>Menu Data</h1>
      <MenuTable />
    </div>
  );
}

export default App;
